description:
Mein geiles Tagebuch 9:
Do.9.8 Mittags beim Gemueseschneiden hat mir Michi seine pralle Gurke praesentiert. Fuer das Dressing sollte ich dann selbst sorgen. Kein Problem! Mit flinker Zunge hab ich ihm ne grosse Portion aus seinem prall gefuellten Sack gelutscht. Fr.10.8 Den Nachmittag haben wir zockend in der oertlichen Daddelhalle verbracht. In nem ploetzlichen Anflug von Geilheit haben wir uns diskret aufs Klo verzogen. Da hab ich Michi meinen neuen String-Tanga gezeigt. Der hatte schlagartig einen stehen! Selbstverstaendlich hab ich sofort fuer Erleichterung bei meinem Liebling gesorgt und bin dabei selbst zweimal gekommen! Sa.11.8 Gleich nach dem Aufwachen haben wir uns spontan um den Verstand gefickt. Die ersten Sonnenstrahlen blitzten durchs Fenster und wir flogen von einem Orgasmus zum Naechsten. Traumhaft! So.12.8 Sonntagsausflug zum Badesee. Herrliches Wetter! Als Michi mit seinen rasierten Eiern in der Sonne lag, konnte ich nicht an mich halten. Ich hab mir mir seinen Schwanz direkt in den Mund gestopft.
Beim anschliessenden Spaziergang gings dann nochmal richtig zur Sache. Geil, geil, geil! &lt;a href=&quot;
